(2, 'Lapiceros ultra delgados', 'lapiceros-ultra-delgados', 'Nuevos buses, para salir de paseo con confort y elegancia en cada uno de sus viajes, brindándole comodidad a sus pasajeros', '<p>Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.</p>\r\n', 1, '2018-02-28', '0', '20170926170253.jpg', 1, 'Lapiceros ultra delgados', '', ''),
